(23, 7, '{\"es\":\"Rollitos de papel arroz\",\"en\":\"Rollitos de papel arroz\"}', '{\"es\":\"Tres rollitos de papel de arroz rellenos de lechuga, zanahoria, espinaca, coco, cacahuate y menta.\\r\\nAcompan\\u0303ados con una ensalada de col morada con ajonjoli\\u0301 y salsa Satay (salsa de cacahuate)\",\"en\":\"Three rice paper rolls filled with lettuce, carrots, spinach, shredded coconut, peanuts & mint. Served with purple cabbage and sesame seeds with soy souce and Satay sauce (peanut based)\"}', '[]', 89, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'coconamor_menu_product_avatar_LDI3OVGS1nR7vCmt.jpeg', NULL, '[]', NULL, NULL, 1),
