(32, 2, '{\"es\":\"Martini seco\",\"en\":\" Dry martini\"}', '{\"es\":\"El martini seco es uno de los c\\u00f3cteles m\\u00e1s conocidos, compuesto de ginebra con un chorro de vermut. Presentaci\\u00f3n en copa de c\\u00f3ctel, adornado con una aceituna cruzada.\",\"en\":\"El martini seco es uno de los c\\u00f3cteles m\\u00e1s conocidos, compuesto de ginebra con un chorro de vermut. Presentaci\\u00f3n en copa de c\\u00f3ctel, adornado con una aceituna cruzada.\"}', '[]', 180, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_I4u92CO6IpNxQXLE.jpeg', NULL, '[]', NULL, NULL, 1),
(33, 2, '{\"es\":\"Poke bowl\",\"en\":\"Poke bowl\"}', '{\"es\":\"Esta receta de salm\\u00f3n con verduras es perfecta para llevar al trabajo, ya que no necesita calentarse, adem\\u00e1s de que es deliciosa y saludable. Este poke bowl es muy f\\u00e1cil de preparar y su sencillo paso a paso te llevar\\u00e1 de la mano para probar esta ensalada muy de moda. \",\"en\":\"This recipe for salmon with vegetables is perfect to take to work, since it does not need to be heated, besides it is delicious and healthy. This poke bowl is very easy to prepare and its simple step by step will take you by the hand to taste this very fashionable salad. \"}', '[]', 200, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_iYZs3y8sAGLLCS4p.jpeg', NULL, '[]', NULL, NULL, 1),
(34, 2, '{\"es\":\"Ensalada campesina\",\"en\":\"Peasant salad\"}', '{\"es\":\"Esta ensalada le dar\\u00e1 un toque especial a todas tus comidas, te sorprender\\u00e1n las texturas. Es una ensalada deliciosa, fresca y muy sencilla de preparar, es la receta perfecta para el verano. \\u00a1Estamos seguros que a t\\u00fa familia le encantar\\u00e1.\",\"en\":\"This salad will give a special touch to all your meals, you will be surprised by the textures. It is a delicious salad, fresh and very simple to prepare, it is the perfect recipe for summer. We are sure that your family will love it.\"}', '[]', 150, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_gOq0VQNRMFS7k825.jpeg', NULL, '[]', NULL, NULL, 1),
(35, 2, '{\"es\":\"Lim\\u00f3n naranja\",\"en\":\"Orange limo\"}', '{\"es\":\"Refresca tus tardes con esta bebida cargada de vitamina C. Su delicioso sabor te fascinara, y lo mejor es que puedes agregarle jengibre, menta, fresas, etc. \\u00a1Lo que se te ocurra!\",\"en\":\"Refresh your afternoons with this drink loaded with vitamin C. Its delicious flavor will fascinate you, and the best thing is that you can add ginger, mint, strawberries, etc. What comes to mind!\"}', '[]', 70, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_zmA7ohzAD4b1Z0W5.jpeg', NULL, '[]', NULL, NULL, 1),
(36, 2, '{\"es\":\"Agua fresca de jamaica\",\"en\":\"Hibiscus refreshing drink\"}', '{\"es\":\"El agua de jamaica se hace a base de la flor infusionada en agua caliente para extraer el sabor y se endulza con az\\u00facar. Tiene un sabor \\u00e1cido y es muy popular en Jamaica, M\\u00e9xico, Centroam\\u00e9rica, Sudam\\u00e9rica y el Caribe, adem\\u00e1s de que es muy econ\\u00f3mica, es muy refrescante.\",\"en\":\"The hibiscus drink is made from the flower infused in hot water to extract the flavor and is sweetened with sugar. It has an acid taste and is very popular in Jamaica, Mexico, Central America, South America and the Caribbean, besides being very economical, it is very refreshing.\"}', '[]', 70, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_dquAHxqOX7RRzbwq.jpeg', NULL, '[]', NULL, NULL, 1),
(37, 2, '{\"es\":\"C\\u00f3ctel de camar\\u00f3n \",\"en\":\"Shrimp cocktail\"}', '{\"es\":\"Prepara este rico c\\u00f3ctel con un toque de jugo de tomate y camar\\u00f3n. Esta receta es ideal para la \\u00e9poca de Cuaresma. Puedes acompa\\u00f1arlo de galletas saladas.\",\"en\":\"Prepare this delicious shrimp cocktail with a touch of tomato juice and shrimp flavor. This recipe is ideal for Lent season. Serve with saltines or your favorite cracker\"}', '[]', 250, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_heArmVKl4Macbe9f.jpeg', NULL, '[]', NULL, NULL, 1),
(38, 2, '{\"es\":\"Agua de pi\\u00f1a con jengibre\",\"en\":\"Pineapple water with ginger\"}', '{\"es\":\"Una rica agua fresca de pi\\u00f1a con un toque de jengibre. Esta receta es Ideal para el verano, el toque de la pi\\u00f1a con el jengibre encantar\\u00e1 a todos.\",\"en\":\"A rich fresh pineapple water with a touch of ginger. This recipe is Ideal for summer, the touch of pineapple with ginger will delight everyone.\\r\\n\"}', '[]', 85, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_EweueGAFD1l3qAXY.jpeg', NULL, '[]', NULL, NULL, 1),
(39, 2, '{\"es\":\"Ceviche a la mexicana\",\"en\":\"Ceviche to the mexican\"}', '{\"es\":\"C\\u00f3ctel de pescado cocido en jugo de lim\\u00f3n verde y acompa\\u00f1ado de jitomates, chile, cilantro y aceitunas, en una salsa de tomate. Receta t\\u00edpica de Acapulco en M\\u00e9xico.\",\"en\":\"Fish cocktail cooked in green lemon juice and accompanied by tomatoes, chile, cilantro and olives, in a tomato sauce. Typical Acapulco recipe in Mexico.\"}', '[]', 200, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_EcLHcXq6s56Jz8Zt.jpeg', NULL, '[]', NULL, NULL, 1),
(40, 2, '{\"es\":\"Agua de pepino con lim\\u00f3n\",\"en\":\"Cucumber Water with Lemon\"}', '{\"es\":\"Agua de Pepino con Lim\\u00f3n, que adem\\u00e1s de refrescante, es un cl\\u00e1sico para la \\u00e9poca de calor o para la hora de la comida.\",\"en\":\"Cucumber Water with Lemon, which, besides being refreshing, is a classic for the hot season or for lunch.\"}', '[]', 65, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_Mrrl9PONI7wHyBTK.jpeg', NULL, '[]', NULL, NULL, 1),
