(286, 9, 6, 'zsqnrpw2', 57, '{\"2\":\"4\",\"3\":\"yes\",\"4\":\"not\",\"5\":\"5\",\"12\":\"4\",\"16\":\"4\",\"19\":\"5\",\"23\":\"5\",\"27\":\"not\",\"31\":\"4\",\"32\":\"yes\",\"33\":\"4\",\"34\":\"5\",\"35\":\"4\",\"36\":\"yes\",\"37\":\"yes\",\"38\":\"not\",\"39\":\"Tuve que hacer otra encuenta porque la anterior se fue incompleta 1. El poco profesionalismo del conserje (Eduardo) al no adquirir paquetes tur\\u00edsticos a trav\\u00e9s de el. Una vez de hizo el rechazo, dejo de contestar o asistir en dudas.  2. El servicio de spa e hidroterapia, la srta tomo 2 d\\u00edas para responder un mensaje en el que se solicitaba una reserva. Poca disponibilidad, falta de personal para realizar masajes para parejas simult\\u00e1neamente. Para el acceso al spa, la informaci\\u00f3n en linea es incompleta, solo se menciona \\u201cacceso al spa\\u201d. Al registrarse se informa que es 1 acceso por estancia, es decir, una persona que se hospede por 1 d\\u00eda, tiene el mismo derecho a una persona que se quede por 4-8 dias. El servicio de hidroterapia es de af\\u00e1n, 5 min de indicaciones, 5 min de ducha, 5 min en sauna, 5 min turco, 5 min piscina, 5 min jacuzzi. El personal muestra una evidente preocupaci\\u00f3n de apagar los equipos y no dar unos minutos extra de jacuzzi mientras uno espera la pareja.  3. Durante la estadia, tuvimos falta de energ\\u00eda el\\u00e9ctrica y agua. Son cosas que son dif\\u00edciles de controlar, y se entiende que puedan pasar. Pero si es importante la forma como se manejan. Tuvimos que bajar de un tercer piso en varias ocasiones en busca de informaci\\u00f3n y soluciones, nadie estuvo pendiente de los canales de comunicaci\\u00f3n c\\u00f3mo whatsapp para proveer atenci\\u00f3n evitando asi tener que ir personalmente. De una cuenta de hospedaje de mas de $550 USD, una habitaci\\u00f3n suite, recibimos una cortes\\u00eda de $12USD. Poco relevante...  4. Propinas, mi esposo y yo venimos de dos pa\\u00edses y culturas distintas, donde las propinas son voluntarias, se incluyen en la cuenta, o se hacen en efectivo, y no se incluyen en los recibos sin ser previamente informadas. Al manejar turistas, la recepci\\u00f3n deber\\u00eda informar que se va a reflejar en su cuenta final una propina por comidas\\/bebidas adquiridos en el bar. As\\u00ed uno no se lleva sorpresas. Realmente, no es el dinero, es no saber que se le va a cobrar. Manuel, el sr del bar fue quien se encargo de hacer nuestra visita agradable, se merece las propinas mas generosas. (Excelente trabajador, s\\u00faper amable, los c\\u00f3cteles deliciosos) 5. La carta de comida del bar esta desactualizado. Pedi tacos, la carta describe 3, recib\\u00ed 2. Precios y cantidades deber\\u00edan estar actualizadas. \"}', NULL, NULL, NULL, NULL, '{\"status\":\"success\",\"firstname\":\"\",\"lastname\":\"\",\"guest_id\":\"\",\"reservation_number\":\"\",\"check_in\":\"\",\"check_out\":\"\",\"nationality\":\"\",\"input_channel\":\"\",\"traveler_type\":\"\",\"age_group\":\"\"}', '2021-02-11', '07:35:06', NULL, 0),
