(427, 9, 6, 'qtmxmbtw', 19, '{\"2\":\"4\",\"3\":\"yes\",\"4\":\"yes\",\"5\":\"5\",\"12\":\"5\",\"16\":\"3\",\"17\":\"4\",\"18\":\"3\",\"19\":\"3\",\"20\":\"3\",\"21\":\"2\",\"22\":\"2\",\"23\":\"4\",\"27\":\"not\",\"31\":\"4\",\"32\":\"not\",\"36\":\"not\",\"40\":\"Precios m\\u00e1s accesibles en el hospedaje. Existe turismo nacional. Y respecto a la atenci\\u00f3n del staff, pude darme cuenta que s\\u00f3lo a los extranjeros les explican los servicios de bar, restaurante y dem\\u00e1s cuestiones del hotel (toalla para la alberca, acceso al internet, horarios, etc). A mi llegada hab\\u00eda dos personas en la recepci\\u00f3n encargadas de eso y para nada se acercaron.  \"}', NULL, NULL, NULL, NULL, '{\"status\":\"success\",\"firstname\":\"\",\"lastname\":\"\",\"guest_id\":\"\",\"reservation_number\":\"\",\"check_in\":\"\",\"check_out\":\"\",\"nationality\":\"\",\"input_channel\":\"\",\"traveler_type\":\"\",\"age_group\":\"\"}', '2021-03-10', '12:12:07', NULL, 0),
(428, 9, 6, 'ewtbgmbf', 42, '{\"2\":\"5\",\"3\":\"yes\",\"4\":\"yes\",\"5\":\"4\",\"12\":\"1\",\"13\":\"4\",\"14\":\"1\",\"15\":\"4\",\"16\":\"5\",\"19\":\"4\",\"23\":\"4\",\"27\":\"not\",\"31\":\"4\",\"32\":\"yes\",\"33\":\"5\",\"34\":\"5\",\"35\":\"5\",\"36\":\"yes\",\"37\":\"yes\",\"38\":\"yes\",\"39\":\"La limpieza no fue buena, nos dejaron toallas sucias, el piso igual que cuando dejamos la habitacion por la ma\\u00f1ana, jamas nos surtieron de jabones ni de los productos que nos acabamos el d\\u00eda anterior.... incluso mi problema fue que en la madrugada meti la mano en la almohada y sent\\u00ed  como me pico algo, me despert\\u00e9  y supe que era una abeja, quien sabe cuanto tiempo estuvo ah\\u00ed,  baje a recepci\\u00f3n  y super  bien la atenci\\u00f3n como siempre, pero  la limpieza nada bien, en esa parte me voy inconforme, ojala puedan mejorar esa parte  y m\\u00e1s  estando en pandemia, es muy delicado este asunto.\",\"40\":\"La gente del hotel wow, las chicas en recepci\\u00f3n super atentas y se ve que adoran su trabajo  aunque a veces pueda ser pesado, pero siempre super pilas ellas y con la mejor actitud, felicidades  Nayeli, Chuy y Tania, son increibles!!!!! Millones de felicidades hacen que la estancia sea una maravilla... las chicas  del spa una maravilla tambien, felicidades Dulce, Rubi y Ana hacen un trabajo excepcional!!!!! Felicidades tambien para Angel un se\\u00f1or lindisimo y ama su trabajo,  siempre con una sonrisa y muy atento y super movido, gracias  por todo lo que hicieron por nosotros para que la estancia fuera maravillosa cada dia... sugerencia supervisen las habitaciones  antes de entregar y sobre todo la parte  de la limpieza.\"}', NULL, NULL, NULL, NULL, '{\"status\":\"success\",\"firstname\":\"\",\"lastname\":\"\",\"guest_id\":\"\",\"reservation_number\":\"\",\"check_in\":\"\",\"check_out\":\"\",\"nationality\":\"\",\"input_channel\":\"\",\"traveler_type\":\"\",\"age_group\":\"\"}', '2021-03-10', '15:34:58', NULL, 0),
(429, 9, 6, 'kil9u79b', 42, '{\"2\":\"5\",\"3\":\"yes\",\"4\":\"yes\",\"5\":\"4\",\"12\":\"1\",\"13\":\"4\",\"14\":\"1\",\"15\":\"4\",\"16\":\"5\",\"19\":\"4\",\"23\":\"4\",\"27\":\"not\",\"31\":\"4\",\"32\":\"yes\",\"33\":\"5\",\"34\":\"4\",\"35\":\"5\",\"36\":\"yes\",\"37\":\"yes\",\"38\":\"yes\",\"39\":\"Encontramos una abeja en la almohada y le pico a mi esposo.\",\"40\":\"Sugerencia: la limpieza de las habitaciones puede ser mejorable.\"}', NULL, NULL, NULL, 'Las chicas en recepción: Tania/ Nayeli/ Chuy, una maravilla, chicas super atentas a su trabajo, movidas, capaces, van más allá y sin duda dan la milla extra!!! Ayudaron a mi esposo a hacer de mi cumple un día excepcional! Gracias chicas ????\r\nEl señor Angel que también está en recepción un señor increíble, sin duda también da la milla extra, siempre con una sonrisa, siempre bien dispuesto a ayudar y hacer las cosas con un espíritu de alegría!! Gracias lo extrañaremos!!\r\nLas chicas del spa: Rubí/Dulce/Luisa WOW super bien, hacían de nuestra estancia en el spa un momento delicioso ☺️ gracias por ayudarnos en nuestra relajación y encontrar un momento de paz, siempre con una sonrisa y muy profesionales!!! Las echaremos de menos!\r\nlos chicos del restaurante: desgraciadamente no recuerdo el nombre de las personas que nos atendieron en mi cumpleaños, pero ellos saben quienes son y agradezco muchísimo su profesionalismo y amor a su trabajo, porque cada minuto en ese restaurante valió la pena! Gracias por ayudar a mi esposo con lo del mariachi, a todos los que tuvieron que ver con esta sorpresa, son un equipo y los felicito!\r\n', '{\"status\":\"success\",\"firstname\":\"\",\"lastname\":\"\",\"guest_id\":\"\",\"reservation_number\":\"\",\"check_in\":\"\",\"check_out\":\"\",\"nationality\":\"\",\"input_channel\":\"\",\"traveler_type\":\"\",\"age_group\":\"\"}', '2021-03-10', '15:46:12', NULL, 0),
