(841, 9, 6, 'ytkaxdo5', 41, '{\"2\":\"5\",\"3\":\"yes\",\"4\":\"yes\",\"5\":\"5\",\"12\":\"5\",\"16\":\"5\",\"19\":\"5\",\"23\":\"5\",\"27\":\"yes\",\"28\":\"5\",\"29\":\"4\",\"30\":\"5\",\"31\":\"3\",\"32\":\"yes\",\"33\":\"5\",\"34\":\"5\",\"35\":\"5\",\"36\":\"not\",\"40\":\"The overall quality of the magic blue spa boutique hotel is really nice and pretty! We enjoyed our stay and would stay again. The aesthetic is very nice and beautiful, giving us a peaceful and serene vibe. The front desk, Ms. Nayeli, was very nice and helpful to us. Not only that, all the staffs and maids that I encountered were friendly as well! Definitely a good hotel to stay if you are in Playa de Carmen!\"}', NULL, NULL, NULL, NULL, '{\"status\":\"success\",\"firstname\":\"Shakia\",\"lastname\":\"Pennix\",\"guest_id\":429376,\"reservation_number\":89702,\"check_in\":\"2021-05-10\",\"check_out\":\"2021-05-13\",\"nationality\":null,\"input_channel\":null,\"traveler_type\":\"Solo traveler\",\"age_group\":\"25 to 44\"}', '2021-05-13', '12:32:18', NULL, 0),
(842, 9, 6, 'q30aqwqd', 36, '{\"2\":\"3\",\"3\":\"not\",\"4\":\"not\",\"5\":\"3\",\"6\":\"3\",\"7\":\"3\",\"8\":\"3\",\"9\":\"3\",\"10\":\"3\",\"11\":\"3\",\"12\":\"4\",\"16\":\"4\",\"19\":\"5\",\"23\":\"3\",\"24\":\"3\",\"25\":\"4\",\"26\":\"4\",\"27\":\"not\",\"31\":\"3\",\"32\":\"not\",\"36\":\"yes\",\"37\":\"yes\",\"38\":\"not\",\"39\":\"Nuestros vuelos llegaron temprano y llegamos al hotel a las 11 a.m. preguntamos por el early check in y nos dijeron que no era posible al menos que se terminara ma limpieza de alguna habitaci\\u00f3n antes , salimos a comer y regresamos 1 p.m. y que a\\u00fan no hab\\u00eda ninguna disponible.Nos topamos con una camarera y nos dijo que ya hab\\u00eda limpiado varias habitaciones.Osea fue cuesti\\u00f3n del servicio de la se\\u00f1orita de recepci\\u00f3n que no nos quiso dar la habitaci\\u00f3n antes.Pesimo \",\"40\":\"No volver\\u00eda al hotel \"}', NULL, NULL, NULL, 'Llegamos varias parejas por recomendación de una de ellas y todas de las que nos hospedamos ninguna regresariamos por que pasaron detalles como el que no servía su aire acondicionado.', '{\"status\":\"success\",\"firstname\":\"Edgar Oziel\\/Jessica\",\"lastname\":\"Castro Mata\",\"guest_id\":430164,\"reservation_number\":89726,\"check_in\":\"2021-05-12\",\"check_out\":\"2021-05-14\",\"nationality\":null,\"input_channel\":null,\"traveler_type\":\"None\",\"age_group\":\"None\"}', '2021-05-14', '10:02:22', NULL, 0),
