(234, 9, 'incident', 'et3armky', 21, 23, 141, '2020-03-08', '13:53:19', NULL, 3, 3366, 'medium', 0, '[]', NULL, 'Pelea entre 2 huespedes ', 'Angol de seguridad solicito la presencia de recepcion en la hab ya que los hspd se estaban peleando a golpes, Andalucía de recepcion intervino tratando de tranquilizar a las hspd ya que no se calmaban. Una de ellas le aventó las cervezas del  mini bar a su acompañante, rompieron la mesa exterior de la hab, una de ellas tenía una herida en la cabeza sangrando y tratando de fumar dentro de la hab. Rene dio autorización para buscar a la policía, en cuanto ingresan los oficiales las huéspedes parecen tranquilizarse, Nayeli de receocion apoyo con idioma para explicarles que será la última ocasión ya que si no cumplen las sacaremos de la habitación ', 'Se les informo que era la ultima ocacion y que deberían pagar todos los consumos y objetos rotos. Ellas están de acuerdo ', 'Alizee Marie/ Astrid Jeanne Fredderique', 'Coet/ Boursier', NULL, NULL, NULL, '87326', NULL, '2020-03-04', '2020-03-11', '[]', '[\"49\",\"27\",\"26\",\"46\"]', '[{\"user\":\"27\",\"date\":\"2020-03-12\",\"hour\":\"10:29:13\",\"cost\":0,\"comment\":\" Cobro de blancos manchados de sangre y cigarro\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"49\",\"date\":\"2020-03-08\",\"hour\":\"13:56:27\"},{\"type\":\"viewed\",\"user\":\"49\",\"date\":\"2020-03-08\",\"hour\":\"13:56:27\"},{\"type\":\"viewed\",\"user\":\"26\",\"date\":\"2020-03-09\",\"hour\":\"05:44:32\"},{\"type\":\"viewed\",\"user\":\"46\",\"date\":\"2020-03-11\",\"hour\":\"10:10:42\"},{\"type\":\"commented\",\"user\":\"27\",\"date\":\"2020-03-12\",\"hour\":\"10:29:13\"},{\"type\":\"completed\",\"user\":\"27\",\"date\":\"2020-03-12\",\"hour\":\"10:29:21\"},{\"type\":\"viewed\",\"user\":\"27\",\"date\":\"2020-03-12\",\"hour\":\"10:29:21\"}]', 49, '2020-03-08', '13:56:27', NULL, NULL, NULL, 27, '2020-03-12', '10:29:21', NULL, NULL, NULL, 0, 0, 'internal'),
