(762, 1, 'workorder', 'mjwwmiyu', 2, 14, 236, '2020-10-20', '16:13:02', NULL, 61, NULL, 'medium', 0, '[\"1\"]', 'Vo.Bo. para creación de contenido para redes sociales.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[]', '[\"1\",\"2\"]', '[{\"user\":\"2\",\"date\":\"2020-10-21\",\"hour\":\"11:08:29\",\"cost\":\"\",\"comment\":\"Propuesta informaci\\u00b4\\u00b4on para creaci\\u00f3n de infograf\\u00edas\\r\\n\\r\\nBlockchain\\r\\n-Tipo de libro de caja distribuido que utiliza cifrado para almacenar registros permanentes.\\r\\n-Prueba de manipulaciones de datos de transacciones.\\r\\n-Datos se almacenan a trav\\u00e9s de una red peer-to-peer utilizando un principio de \\\"consenso\\\" para validar cada transacci\\u00f3n.\\r\\n\\r\\n\\r\\nCloud\\r\\n-*Ingl\\u00e9s: Cloud Storage\\r\\n- Es un modelo de almacenamiento de datos basado en redes de computadoras.\\r\\n-Los datos est\\u00e1n alojados en espacios de almacenamiento virtualizados, por lo general aportados por terceros.\\r\\n\\r\\nWebs m\\u00f3viles\\r\\n-M\\u00f3vil = pieza fundamental en el desarrollo de tendencias hoteleras.\\r\\n- P\\u00e1gina de web en vesi\\u00f3n m\\u00f3vil que permiten hacer reservas desde cualquier lugar.\\r\\n- Versiones m\\u00f3viles para cada tipo de dispositivo y para cada tipo de target adaptada al concepto de \\\"Micro-Momento\\\".\\r\\n\\r\\n\\r\\nB\\u00fasquedas por voz\\r\\n-Los servicios de reconocimiento por voz tienen cada vez m\\u00e1s y m\\u00e1s usuarios.\\r\\n- Los usuarios que buscan mediante voz es porque necesitan una respuesta inmediata y directa.\\r\\n- Contenido m\\u00e1s rico tanto en redacci\\u00f3n como en vocabulario, homogeneizar y naturalizar todav\\u00eda m\\u00e1s el contenido web.\\r\\n\\r\\n\\r\\nDispositivos interconectados\\r\\n- Mayor interacci\\u00f3n como consumidor\\/ cliente\\r\\n- Flexibilidad, movilidad, automatizaci\\u00f3n y eficiencia.\\r\\n- Mejor servicio y experiencia para el cliente.\\r\\n\\r\\nChatbot \\r\\n- Programa que simula mantener una conversaci\\u00f3n con una persona al proveer respuestas autom\\u00e1ticas.\\r\\n- La conversaci\\u00f3n se establece mediante texto.\\r\\n- Hay modelos que disponen de una interfaz de usuario multimedia\\r\\n- Comienzan a utilizar programas conversores de texto a sonido (CTV), dot\\u00e1ndolo de mayor realismo a la interacci\\u00f3n con el usuario\\r\\n\\r\\n\\r\\nReservas Directas con metab\\u00fascadores\\r\\n-Aumenta las reservas directas\\r\\n- Proceso de reserva m\\u00e1s sencillo, r\\u00e1pido, seguro.\\r\\n- Ahorrar dinero por precios m\\u00e1s bajos, sin comisiones.\\r\\n- Mayor flexibilidad de la reserva.\\r\\n- Contacto directo con el cliente\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"2\",\"date\":\"2020-10-20\",\"hour\":\"16:13:25\"},{\"type\":\"commented\",\"user\":\"2\",\"date\":\"2020-10-21\",\"hour\":\"11:08:29\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"assigned_users\",\"before\":[\"2\"],\"after\":[\"1\"]}],\"user\":\"2\",\"date\":\"2020-10-21\",\"hour\":\"11:09:47\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"observations\",\"before\":\"Creaci\\u00f3n de contenido para redes sociales.\",\"after\":\"Vo.Bo. para creaci\\u00f3n de contenido para redes sociales.\"}],\"user\":\"2\",\"date\":\"2020-10-21\",\"hour\":\"11:10:20\"},{\"type\":\"viewed\",\"user\":\"1\",\"date\":\"2020-10-21\",\"hour\":\"20:23:21\"},{\"type\":\"viewed\",\"user\":\"2\",\"date\":\"2020-11-09\",\"hour\":\"19:38:09\"},{\"type\":\"completed\",\"user\":\"2\",\"date\":\"2020-11-09\",\"hour\":\"19:38:09\"}]', 2, '2020-10-20', '16:13:25', 2, '2020-10-21', '11:10:20', 2, '2020-11-09', '19:38:09', NULL, NULL, NULL, 0, 0, 'internal'),
