(899, 20, 'request', 'hrdhnsxu', 287, 43, 279, '2020-11-08', '13:55:27', NULL, 66, NULL, 'high', 0, '[\"94\",\"91\",\"80\",\"95\",\"93\"]', 'Discrepancia en sistema y fisicamente en habitación cama 432 en sistema ocupada pero está vacía sucia y el huésped d cama 434 con  nombre Chris está ocupando esa la misma cuando en sistema está en la 432  salió una cama sucia extra ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[{\"status\":\"success\",\"file\":\"hotelcasapepe_vox_attachment_Z5SuynPiue0N3ALk.jpeg\",\"route\":\"\\/var\\/www\\/vhosts\\/guestvox.com\\/httpdocs\\/uploads\\/hotelcasapepe_vox_attachment_Z5SuynPiue0N3ALk.jpeg\"}]', '[\"92\",\"95\",\"93\",\"94\"]', '[{\"user\":\"93\",\"date\":\"2020-11-08\",\"hour\":\"16:04:11\",\"cost\":\"\",\"comment\":\"En sistema Memo hizo cambio de habitaci\\u00f3n para Chris Campbell el 7\\/11 a las 5:07am. \\r\\nDespu\\u00e9s, el 8\\/11 a las 00:01 Memo cambio registro cambio de cama de la 434 a la 432.\\r\\nDespu\\u00e9s Moni hoy hizo cambio de la  432 a la 434 (despu\\u00e9s de las discrepancias).\\r\\nPor lo que dice Moni y Sarita el huesped estuvo todo el tiempo en la 432 pero encontraron la 434 sucia.\\r\\nVoy a preguntarle a Memo si sabe algo.\\r\\n\\r\\nEl huesped de la 252 no esta en su cama y la cama esta limpia, pero no est\\u00e1 en el hostal. Tiene pagado hasta el 10\\/11. Yo lo vi salir el viernes pero no parecia que se fuera para regresar despu\\u00e9s. Le voy a preguntar a Olga cuando fue que limpio la cama y borro el nombre que estaba en el pizarr\\u00f3n.\\r\\n\\r\\n\",\"attachments\":[]},{\"user\":\"93\",\"date\":\"2020-11-08\",\"hour\":\"23:10:48\",\"cost\":\"\",\"comment\":\"Preguntandole a Alistair de la 436 (Reserva a nombre de Joshua) me dijo que Joshua, 435, se durmi\\u00f3 en la 434, por eso la cama estaba sucia, no fue que alguien m\\u00e1s se durmiera en la habitaci\\u00f3n. Tampoco que yo haya metido a alguien o cambiado de cama sin avisar como se me dijo que podr\\u00eda haber sido. Ya le coment\\u00e9 al huesped Alistair que es una penalizaci\\u00f3n hacer estos cambios.\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"92\",\"date\":\"2020-11-08\",\"hour\":\"14:00:17\"},{\"type\":\"viewed\",\"user\":\"92\",\"date\":\"2020-11-08\",\"hour\":\"14:00:57\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"attachments\",\"before\":[],\"after\":[{\"status\":\"success\",\"file\":\"hotelcasapepe_vox_attachment_Z5SuynPiue0N3ALk.jpeg\",\"route\":\"\\/var\\/www\\/vhosts\\/guestvox.com\\/httpdocs\\/uploads\\/hotelcasapepe_vox_attachment_Z5SuynPiue0N3ALk.jpeg\"}]}],\"user\":\"95\",\"date\":\"2020-11-08\",\"hour\":\"14:01:54\"},{\"type\":\"viewed\",\"user\":\"95\",\"date\":\"2020-11-08\",\"hour\":\"14:41:09\"},{\"type\":\"commented\",\"user\":\"93\",\"date\":\"2020-11-08\",\"hour\":\"16:04:11\"},{\"type\":\"commented\",\"user\":\"93\",\"date\":\"2020-11-08\",\"hour\":\"23:10:48\"},{\"type\":\"viewed\",\"user\":\"93\",\"date\":\"2020-11-08\",\"hour\":\"23:17:39\"},{\"type\":\"viewed\",\"user\":\"94\",\"date\":\"2020-11-09\",\"hour\":\"07:30:24\"},{\"type\":\"completed\",\"user\":\"94\",\"date\":\"2020-11-09\",\"hour\":\"07:30:24\"}]', 92, '2020-11-08', '14:00:17', 93, '2020-11-08', '23:11:02', 94, '2020-11-09', '07:30:24', NULL, NULL, NULL, 0, 0, 'internal'),
